import React from "react";
import { Box, Button, Typography } from "@mui/material";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from "recharts";

function DiagnosisPage() {
  const navigate = useNavigate();
  const [diagnosis, setDiagnosis] = React.useState([]);
  const [chartData, setChartData] = React.useState([]);

  React.useEffect(() => {
    // Fetch diagnosis and chart data
    axios.get("/diagnose").then((response) => {
      setDiagnosis(response.data.diagnosis);
      axios.get("/trend_chart").then((chartRes) => {
        setChartData(chartRes.data); // Ensure backend provides JSON data
      });
    });
  }, []);

  return (
    <Box p={4}>
      <Button variant="outlined" onClick={() => navigate("/")}>
        Back to Chat
      </Button>
      <Typography variant="h4" mt={2}>Mental Health Diagnosis</Typography>
      {diagnosis.map((item, index) => (
        <Box key={index} mt={2}>
          <Typography variant="h6">{item.condition}</Typography>
          <Typography>Severity: {item.severity}</Typography>
        </Box>
      ))}
      <Typography variant="h5" mt={4}>Severity Trends</Typography>
      <LineChart width={600} height={300} data={chartData}>
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="timestamp" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Line type="monotone" dataKey="trend_score" stroke="#8884d8" />
      </LineChart>
    </Box>
  );
}

export default DiagnosisPage;
